

const map = new ol.Map({
  target: 'map',
  layers: [
    new ol.layer.Tile({
      source: new ol.source.OSM()
    })
  ],
  view: new ol.View({
    center: ol.proj.fromLonLat([-2.55993335, 53.7187004]),
    zoom: 10
  })
});

// Load the CSV data and add it to the map
$.ajax({
  url: './2157-01-blackburn-scanner-video-2021.csv',
  success: function(csvData) {
    // Parse the CSV data into an array of features
    const features = parseCsv(csvData);

    // Create a vector source and add the features to it
    const vectorSource = new ol.source.Vector({
      features: features
    });

    // Create a vector layer
    const vectorLayer = new ol.layer.Vector({
      source: vectorSource,
      style: new ol.style.Style({
        image: new ol.style.Circle({
          radius: 6,
          fill: new ol.style.Fill({
            color: 'blue'
          }),
          stroke: new ol.style.Stroke({
            color: 'red',
            width: 2
          })
        })
      })
    });

    // Add the vector layer to the map
    map.addLayer(vectorLayer);

    // Handle click events on the features
    map.on('click', function(event) {
      // Check if a feature was clicked
      const feature = map.forEachFeatureAtPixel(event.pixel, function(feature) {
        return feature;
      });
      if (feature) {
        // Display the feature attributes in a dialog box
        let content = '';
        const attributes = feature.getProperties();
        for (const attribute in attributes) {
          content += '<b>' + attribute + ':</b> ' + attributes[attribute] + '<br>';
        }
        $('#dialog').html(content).dialog({
          modal: true,
          minWidth: 400
        });
      }
    });
  }
});

